        navigate(path);
    }

  return (
    <div className="mainLogin">

        <h2>UserName</h2>
        <input placeholder="Ex: toto"  type="text" ></input>

        <h2>Password</h2>
        <input placeholder="Ex: 123.."  type="password" ></input>

        <button className="btn" onClick={routeChangeLogin}>
          Sign In
        </button>
        
    </div>
  )
}

